import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
    <div>
      <BrowserRouter>
      <Routes>
      <Route path="/" element={Home} />
      <Route path="view" element={View} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
